(function() 
{
   var data = '';
   var player = new MusicXMLPlayer(atob(data));
   player.waitReady().then(function()
   {
      document.getElementById("buttons").innerHTML = "<button id=\"play\">Play</button><button id=\"pause\">Pause</button><button id=\"stop\">Stop</button>";
      
      document.getElementById("play").onclick = function()
      {
         document.getElementById("logs").innerHTML += 'Play<br/>';
         player.start(function(id)
         {
            document.getElementById("logs").innerHTML += 'Start measure '+id+'<br/>';
         }, function()
         {
            document.getElementById("logs").innerHTML += 'Finished !<br/>';
         })
      }
   
      document.getElementById("pause").onclick = function()
      {
         player.pause();
      }
   
      document.getElementById("stop").onclick = function()
      {
         player.stop();
      }
   })
})();